import React from 'react';
import './App.css';
import { Router, Routes, BrowserRouter,Switch } from 'react-router-dom';
import Home from './pages/Home';

function App() {
	return (
		<BrowserRouter>
			<Routes>
				<Router path='/' element={<Home />}/>
			</Routes>
		</BrowserRouter>
	);
}

export default App;
